import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';



class HomeScreen extends React.Component {
  render() {
    return <div className="home_screen"></div>
  }
}



ReactDOM.render(
  <HomeScreen />, 
  document.getElementById('root')
);
